import React from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import axios from "axios";
import { Container, Card, Button } from "react-bootstrap";
import { Helmet } from "react-helmet";
import { useNavigate } from "react-router-dom";
import { useLocation } from 'react-router-dom';

export const ParticepentForm = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const division_id = queryParams.get('division_id'); // Assuming you may have division_id in query params

  const initialValues = {
    name: "",
    date_of_birth: "",
    belt_color: "",
    division_id: division_id,
  };

  const validationSchema = Yup.object().shape({
    name: Yup.string().required("Name is required"),
    date_of_birth: Yup.date().required("Date of Birth is required"),
    belt_color: Yup.string().required("Belt Color is required"),
    division_id: Yup.number().required("Division ID is required"),
  });

  const onSubmit = async (values, { setSubmitting }) => {
    console.log("Submitting values:", values);
    try {
      const accessToken = localStorage.getItem("accessToken");
      if (!accessToken) {
        console.error("Access token not found. API request not made.");
        return;
      }

      const response = await axios.post("http://localhost:3001/participants", values, {
        headers: {
          accessToken: accessToken,
          "Content-Type": "application/json",
        },
      });

      console.log("Request successful:", response.data);
      navigate("/Home");
    } catch (error) {
      console.error("Error:", error);
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <Container style={{ marginTop: "20vh" }}>
      <Helmet>
        <title>Create Participant</title>
        <meta name="description" content="Description of your page" />
      </Helmet>
      <Card bg="secondary" text="white">
        <Card.Body>
          <h4 className="card-title">Create Participant</h4>
          <p className="card-text">Please complete the form. It's simple</p>
          <Formik initialValues={initialValues} onSubmit={onSubmit} validationSchema={validationSchema}>
            {(formik) => (
              <Form>
                <div className="mb-3">
                  <label htmlFor="name" className="form-label">
                    Name:
                  </label>
                  <ErrorMessage name="name" component="div" className="text-danger" />
                  <Field
                    type="text"
                    id="name"
                    name="name"
                    placeholder="Enter name"
                    className="form-control"
                  />
                </div>

                <div className="mb-3">
                  <label htmlFor="date_of_birth" className="form-label">
                    Date of Birth:
                  </label>
                  <ErrorMessage name="date_of_birth" component="div" className="text-danger" />
                  <Field
                    type="date"
                    id="date_of_birth"
                    name="date_of_birth"
                    className="form-control"
                  />
                </div>

                <div className="mb-3">
                  <label htmlFor="belt_color" className="form-label">
                    Belt Color:
                  </label>
                  <ErrorMessage name="belt_color" component="div" className="text-danger" />
                  <Field
                    type="text"
                    id="belt_color"
                    name="belt_color"
                    placeholder="Enter belt color"
                    className="form-control"
                  />
                </div>

                <div className="mb-3">
                  <label htmlFor="division_id" className="form-label">
                    Division ID:
                  </label>
                  <ErrorMessage name="division_id" component="div" className="text-danger" />
                  <Field
                    type="number"
                    id="division_id"
                    name="division_id"
                    placeholder="Enter division ID"
                    className="form-control"
                    disabled={!!division_id} // Disable field if division_id is present in query params
                  />
                </div>

                <Button type="submit" variant="primary" disabled={formik.isSubmitting}>
                  Create Participant
                </Button>
              </Form>
            )}
          </Formik>
        </Card.Body>
      </Card>
    </Container>
  );
};
